/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `t_notification_before_ins_tr` BEFORE INSERT ON `t_notification`
  FOR EACH ROW
BEGIN


	INSERT INTO t_notification_jour (DateHeureNotif, MotifNotif,notif_cpt) 
    		VALUES (CAST(NEW.DateHeureNotif AS DATE), NEW.MotifNotif, NEW.MotifCpt)
	        ON DUPLICATE KEY UPDATE notif_cpt=notif_cpt+1;
        
	INSERT INTO t_notification_mois (notif_year, notif_month, MotifNotif, notif_cpt)
	        VALUES (YEAR( CAST(NEW.DateHeureNotif AS DATE) ), MONTH( CAST(NEW.DateHeureNotif AS DATE) ), NEW.MotifNotif, NEW.MotifCpt)
	        ON DUPLICATE KEY UPDATE notif_cpt=notif_cpt+1;

END */;;
