	UPDATE t_notification_jour 
        SET     MotifNotif  = NEW.MotifNotif
        WHERE   DateHeureNotif  = OLD.DateHeureNotif;
        
    UPDATE t_notification_mois 
        SET     MotifNotif  = NEW.MotifNotif
        WHERE   notif_year     = YEAR( OLD.DateHeureNotif )
            AND notif_month    = MONTH( OLD.DateHeureNotif );
END */;;
