CREATE DEFINER=`sofie`@`%` PROCEDURE `P_UPDATE_PANNE`(
        IN _NUMAPPEL VARCHAR(20),
        IN _NUMPANNE VARCHAR(5),
        IN _UP_TYPE VARCHAR(20),
        IN _UP_STATUS TINYINT(2),
        IN _STATUTPANNE TINYINT(2),
        OUT _UPDATE_RESULT TINYINT(2)
    )
BEGIN

DECLARE STATUTPANNE VARCHAR(10);
DECLARE MOTIFAPPEL TINYINT(2);

DECLARE EXIT HANDLER FOR SQLEXCEPTION ROLLBACK;
DECLARE EXIT HANDLER FOR SQLWARNING ROLLBACK;	
START TRANSACTION;	

SET STATUTPANNE=(IF(_STATUTPANNE>1,"PANNE","MARCHE"));

IF (_UP_TYPE<>'') THEN

		IF (_UP_TYPE='PANNE_PRISE_CHARGE') THEN	
    	SET MOTIFAPPEL=2;
		UPDATE `t_panne` SET `t_panne`.`DatePriseCharge`=NOW(),`t_panne`.`sync`='N',`t_panne`.`StatutPanne`=IF(_STATUTPANNE<>'',_STATUTPANNE,`t_panne`.`StatutPanne`) WHERE `t_panne`.`IDOuvrage`=f_getIDOuvrageByNumPanne(_NUMPANNE);

	END IF;

	IF _UP_TYPE='DEBUT_REP_PANNE' THEN
    	SET MOTIFAPPEL=3;
		UPDATE `t_panne` SET `t_panne`.`DateDebutRep`=NOW(),`t_panne`.`sync`='N',`t_panne`.`StatutPanne`=IF(_STATUTPANNE<>'',_STATUTPANNE,`t_panne`.`StatutPanne`) WHERE `t_panne`.`IDOuvrage`=f_getIDOuvrageByNumPanne(_NUMPANNE);	

	END IF;

	IF _UP_TYPE='PANNE_REPARER' THEN
    	SET MOTIFAPPEL=4;
		UPDATE `t_panne` SET `t_panne`.`DateReparation`=NOW(),`t_panne`.`sync`='N',`t_panne`.`StatutPanne`=IF(_STATUTPANNE<>'',_STATUTPANNE,`t_panne`.`StatutPanne`) WHERE `t_panne`.`IDOuvrage`=f_getIDOuvrageByNumPanne(_NUMPANNE);	

	END IF;
    
    IF _UP_TYPE='PANNE_NONREPARE' THEN
    	SET MOTIFAPPEL=6;
		UPDATE `t_panne` SET `t_panne`.`DateReparation`=NOW(),`t_panne`.`sync`='N',`t_panne`.`StatutPanne`=IF(_STATUTPANNE<>'',_STATUTPANNE,`t_panne`.`StatutPanne`) WHERE `t_panne`.`IDOuvrage`=f_getIDOuvrageByNumPanne(_NUMPANNE);	

	END IF;
    
    IF (_UP_STATUS=1) THEN
    	
		UPDATE `t_ouvrage` SET `t_ouvrage`.`StatutOuvrage`=IF((_STATUTPANNE>1),"Panne","Marche"),`t_ouvrage`.`sync`='N',`t_ouvrage`.`Statut`=_STATUTPANNE,`t_ouvrage`.`StatutPanne`=IF((`t_ouvrage`.`StatutPanne`>=_STATUTPANNE AND `t_ouvrage`.`StatutPanne`<>6),`t_ouvrage`.`StatutPanne`,_STATUTPANNE),`t_ouvrage`.`DateMiseAjour`=NOW() WHERE `t_ouvrage`.`IDOuvrage`=`f_getIDOuvrageByNumPanne`(_NUMPANNE);
            
    END IF;
        
    CALL `P_INSERT_APPELTELEPHONIQUE`(MOTIFAPPEL,f_getPanneIdByPanneTicket(_NUMPANNE),f_getIDNumappelByNumAppel(_NUMAPPEL));
    
    SET _UPDATE_RESULT=1;
 	
ELSE

	SET _UPDATE_RESULT=0;
    
END IF;
	
	COMMIT; 
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `P_UPDATE_PANNE_BY_CODE_PROFILE` */;
