CREATE DEFINER=`sofie`@`%` PROCEDURE `P_UPDATE_PANNE_BY_CODE_PROFILE`(
        IN _NUMPANNE VARCHAR(5),
        IN _CODE_PROFILE TINYINT(4),
        IN _STATUTPANNE TINYINT(2),
        OUT _UPDATE_RESULT TINYINT(2)
    )
BEGIN

DECLARE EXIT HANDLER FOR SQLEXCEPTION ROLLBACK;
DECLARE EXIT HANDLER FOR SQLWARNING ROLLBACK;	
START TRANSACTION;

SET @requete = 'UPDATE `t_panne` SET ';

IF (_DATEPRISECHARGE<>'0000-00-00 00:00:00') THEN	
	SET @requete = CONCAT(@requete,"`t_panne`.`sync`='N',`t_panne`.`DatePriseCharge`='",_DATEPRISECHARGE,"',");
END IF;

IF _DATEDEBUTREP<>'0000-00-00 00:00:00' THEN	
	SET @requete = CONCAT(@requete,"`t_panne`.`sync`='N',`t_panne`.`DateDebutRep`='",_DATEDEBUTREP,"',");
END IF;

IF _DATEREPARATION<>'0000-00-00 00:00:00' THEN	
	SET @requete = CONCAT(@requete,"`t_panne`.`sync`='N',`t_panne`.`DateReparation`='",_DATEREPARATION,"',");
END IF;

IF _STATUTPANNE<>'' THEN	
    SET @requete = CONCAT(@requete,"`t_panne`.`sync`='N',`t_panne`.`StatutPanne`='",_STATUTPANNE,"'");
END IF;

SET @requete = CONCAT(@requete," WHERE `t_panne`.`NumPanne`='",_NUMPANNE,"'");

SET @requete2 = CONCAT(' UPDATE `t_ouvrage` SET `t_ouvrage`.`DateMiseAjour`=NOW()',"`t_ouvrage`.`sync`='N'",' `t_ouvrage`.`StatutOuvrage`=IF((',_STATUTPANNE,' > '"1"'),"Panne","Marhe"),`t_ouvrage`.`Statut`="',_STATUTPANNE,'" WHERE `t_ouvrage`.`IDOuvrage`=`f_getIDOuvrageByNumPanne`(',_NUMPANNE,')');


PREPARE stmt1 FROM @requete;
EXECUTE stmt1 ;
DEALLOCATE PREPARE stmt1;

PREPARE stmt1 FROM @requete2;
EXECUTE stmt1 ;  
DEALLOCATE PREPARE stmt1;

COMMIT; 
   
SET _UPDATE_RESULT=1;



END ;;
DELIMITER ;
