CREATE DEFINER=`sofie`@`%` PROCEDURE `P_UPDATE_PANNE_BY_NUM_COMITE`(
        IN _NUMCOMITE VARCHAR ( 12 ) ,
        IN _STATUTPANNE TINYINT ( 4 ) ,
        OUT _UPDATE_RESULT TINYINT ( 2 )
    )
    DETERMINISTIC
    SQL SECURITY INVOKER
BEGIN  

DECLARE IDPANNE INTEGER(11);
DECLARE EXIT HANDLER FOR SQLEXCEPTION ROLLBACK;
DECLARE EXIT HANDLER FOR SQLWARNING ROLLBACK;

SET _UPDATE_RESULT=0;	

START TRANSACTION;	

SET IDPANNE=f_getIDPanneByIDOuvrage(`f_getIDOuvrageByNumAppel`(_NUMCOMITE));

UPDATE `t_panne` SET `t_panne`.`DateReparation`=NOW(),`t_panne`.`sync`='N',`t_panne`.`StatutPanne`=_STATUTPANNE WHERE `t_panne`.`IDOuvrage`=`f_getIDOuvrageByNumAppel`(_NUMCOMITE);

UPDATE `t_ouvrage` SET `t_ouvrage`.`StatutOuvrage`=IF(_STATUTPANNE>1,"Panne","Marche"),`t_ouvrage`.`sync`='N',`t_ouvrage`.`Statut`=_STATUTPANNE,`t_ouvrage`.`StatutPanne`=_STATUTPANNE,`t_ouvrage`.`dateStatut`=NOW() WHERE `t_ouvrage`.`IDOuvrage`=`f_getIDOuvrageByNumAppel`(_NUMCOMITE);

CALL `P_INSERT_APPELTELEPHONIQUE`(IF(_STATUTPANNE>1,1,4),IDPANNE,f_getIDNumappelByNumAppel(_NUMCOMITE));

SET _UPDATE_RESULT=1;

COMMIT;

END ;;
