CREATE DEFINER=`sofie`@`%` PROCEDURE `P_UPDATE_RESTORE_IDAGENTFORMA_BY_NUMAPPEL`(
        IN _NUMAPPEL VARCHAR(20),
        OUT _NUMAPPEL_INTERIM VARCHAR(20),
        OUT _NOM_AGENT VARCHAR(150),
        OUT _UPDATE_RESULT TINYINT(2)
    )
    DETERMINISTIC
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION ROLLBACK;
	DECLARE EXIT HANDLER FOR SQLWARNING ROLLBACK;	
	START TRANSACTION;
    
        
    SELECT `f_getNumAppelByIDNumAppel`(`t_agent`.`IDNumAppelNotification`) AS NUMAPPEL_INTERIM,f_getNomPrenomsAgentByIDNumAppel(`t_agent`.`IDNumAppel`) AS NOM_AGENT INTO _NUMAPPEL_INTERIM,_NOM_AGENT
    FROM `t_agent` 
    WHERE `t_agent`.`InitSatus`=2 AND `t_agent`.`IDAgent`=`f_getIDAgentByIDNumAppel`(f_getIDNumappelByNumAppel(_NUMAPPEL));    
    
    UPDATE `t_agent` 
    SET `t_agent`.`IDNumAppelNotification`=IF(`t_agent`.`InitSatus`=2,`t_agent`.`IDNumAppel`,`t_agent`.`IDNumAppelNotification`),`t_agent`.`sync`='N',`t_agent`.`InitSatus`=1
    WHERE `t_agent`.`IDAgent`=`f_getIDAgentByIDNumAppel`(f_getIDNumappelByNumAppel(_NUMAPPEL));
    
	CALL `P_INSERT_APPELTELEPHONIQUE`(6,0,f_getIDNumappelByNumAppel(_NUMAPPEL));
    
    SET _UPDATE_RESULT=1;
    
    COMMIT;

END ;;
