CREATE DEFINER=`sofie`@`%` PROCEDURE `P_VERIF_INIT_CODE`(
        IN _CODE_INIT VARCHAR ( 10 ) ,
        IN _CODE_PROFIL TINYINT ( 2 ) ,
        OUT _INIT_STATUS TINYINT ( 2 ) ,
        OUT _CODE_VALIDITY TINYINT ( 2 )
    )
BEGIN
	IF _CODE_PROFIL=1 THEN
    
    	SELECT IF(COUNT(*)>0,1,0) INTO _CODE_VALIDITY
        FROM `t_comite`,t_ouvrage
        WHERE
        `t_comite`.`IDComite`=`t_ouvrage`.`IDComite` AND
        `t_comite`.`CodeInitComite`=_CODE_INIT AND 
        ISNULL(t_comite.deleted_at) AND  
        ISNULL(`t_ouvrage`.`deleted_at`);	
    
		SELECT IF(COUNT(*)>0,1,0) INTO _INIT_STATUS
        FROM `t_comite`
        WHERE `t_comite`.`CodeInitComite`=_CODE_INIT 
        AND
        `t_comite`.`InitSatus`>0; 
    END IF;
    
    IF _CODE_PROFIL=2 THEN
    
    	SELECT IF(COUNT(*)>0,1,0) INTO _CODE_VALIDITY
        FROM `t_reparateur`,t_ouvrage
        WHERE 
        `t_reparateur`.`IDReparateur`=`t_ouvrage`.`IDReparateur` AND
        `t_reparateur`.`CodeInitRep`=_CODE_INIT;
    
    	SELECT IF(COUNT(*)>0,1,0) INTO _INIT_STATUS
        FROM `t_reparateur`
        WHERE 
        `t_reparateur`.`CodeInitRep`=_CODE_INIT 
        AND
        `t_reparateur`.`InitSatus`>0;
    END IF;
    
    IF _CODE_PROFIL>2 THEN
    
    	SELECT IF(COUNT(*)>0,1,0) INTO _CODE_VALIDITY
        FROM `t_agent`,t_ouvrage
        WHERE 
        `t_agent`.`IDRegion`=`t_ouvrage`.`IDRegion` AND
        `t_agent`.`CodeInitAgent`=_CODE_INIT;
    
    	SELECT IF(COUNT(*)>0,1,0) INTO _INIT_STATUS
        FROM `t_agent`
        WHERE `t_agent`.`CodeInitAgent`=_CODE_INIT 
        AND
        `t_agent`.`InitSatus`>0;
    END IF;
    
END ;;
DELIMITER ;
